      string: "{\"query\":\"OpenLLMetry\",\"follow_up_questions\":null,\"answer\":null,\"images\":[],\"results\":[{\"url\":\"https://www.traceloop.com/docs/openllmetry/introduction\",\"title\":\"What
        is OpenLLMetry? - traceloop\",\"content\":\"light logo\\ndark logo\\n\\n#####
        Introduction\\n\\n##### Quick Start\\n\\n##### Tracing\\n\\n##### Integrations\\n\\n#####
        Privacy\\n\\n##### Contribute\\n\\n# What is OpenLLMetry?\\n\\nOpenLLMetry
        is an open source project that allows you to easily start monitoring and debugging
        the execution of your LLM app.\\nTracing is done in a non-intrusive way, built
        on top of OpenTelemetry.\\nYou can choose to export the traces to Traceloop,
        or to your existing observability stack.\",\"score\":0.947386,\"raw_content\":null},{\"url\":\"https://docs.llamaindex.ai/en/stable/examples/observability/OpenLLMetry/\",\"title\":\"Observability
        with OpenLLMetry - LlamaIndex\",\"content\":\"OpenLLMetry is an open-source
        project based on OpenTelemetry for tracing and monitoring LLM applications.
        It connects to all major observability platforms (like Datadog, Dynatrace,
        Honeycomb, New Relic and others) and installs in minutes.\\n\\nIf you're opening
